import React, { Component } from 'react';

class TodoItem extends Component {

	constructor(props){
		super(props);
		this.handleClick = this.handleClick.bind(this)
	}

	render() {
		return (
			<div onClick={this.handleClick.bind(this)}>
				{this.props.content}
			</div>)
	}

	handleClick() {
		alert(this.props.index);
	}
}

export default TodoItem;
